import React from 'react';
import { Route } from 'react-router-dom';
import { isLogged } from '../helpers/AuthHandler';

export default ({ children, ...rest }) => {
    let logged = isLogged();
    return (
        <Route
            {...rest}
            render={() => children}
        />
    );
}
